export default function ItemList({
category,
  notebookProduct,
  desktopProduct,
}) {
  return (
    <div>
      {(category == "notebook") ? (
       <h1>Notebook</h1>)
       : (
        desktopProduct.map(function(item){
            return(
                <div>
              <h1>{item.id}</h1>
            </div>
            )
        })
      )}
    </div>
  );
}
